// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));


interface InfoProps {
    className ?: string
    user: User
}

interface User {
    address: String
    avatar: String
    birthday: String
    email: String
    facebook: String
    first_name: String
    gender: String
    google_id: String
    id: String
    intro: String
    last_name: String
    phone: String
    mobile: String
    skype: String
    username: String
    viber: String
    website: String
    zalo: String
    created_at: String
    updated_at: String
}

const Info: React.FunctionComponent<InfoProps> = (props: InfoProps) => {
    const { className, ...rest } = props
    const classes = useStyles()
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <Typography>
                {/* {props.user.address} */}
            </Typography>
            <Typography>
                {/* {props.user.birthday} */}
            </Typography>
        </div>
    );
};


export default Info;
